Dzień dobrym, mam do sprzedania samochód osobowy marki Citroen Xsara Picasso wyprodukowany w 2001 roku, który został wyposażony w silnik benzynowy, doposażony w instalacje LPG o pojemności 1749cm3, legitymujący się mocą 115 KM, który pokonał do tej pory 320000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Citroen prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



Xsara jest wyposażenia w:

- Klimatyzacje;

- Elektryczne szyby przednie i tylne;

- Elektrycznie regulowane i podgrzewane lusterka;

- ABS;

- Centralny zamek;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód można obejrzeć w Łodzi po wcześniejszym umówieniu się.



OC ważne do 27.05.2025 roku.

Przegląd techniczny 21.06.2025 roku.

